import React from 'react';
import Navigation from '../components/Navigation';
import Temoignages from '../components/Temoignages';
import Footer from '../components/Footer';

const Formation = () => {
  return (
    <div>
      <Navigation />
      Formation
      <Temoignages />
      <Footer />
    </div>
  );
};

export default Formation;
